window.bookSummaryJSON = "<p>The Spectral City of Cathella is shrouded in strange magic of a powerful artifact. Krian must face the Great Dragons of Pangea, an impossible quest on the Ancient Paths, transformed by the Twice Cursed God, a journey through an endless graveyard, the smile of the Goddess of Stealth....&nbsp;</p> <p>And rage. Infinite rage. The path to the higher plane never seems to end, too much for any man to overcome....</p> <p>But not for an Elder Demon. And so he soldiers on, after the black crow and toward the red moon over hanging over the valleys of Karn.</p>"; 
